contract  RaiseFunds{
    using SafeMath for uint;



    modifier onlyOwner() {
        require(owner == msg.sender, "Ownable: caller is not the owner");
        _;
    }

    IERC20 dcf = IERC20(address(0xB1Cd8ad16899318DA9F0A2c9933d599eB9cdC10c));

    uint price = 3000000000000;
    address owner;

    constructor(){
        owner = msg.sender;
    }

    function subscribe()external payable{
        require(msg.value >= 1e16);
        uint dcf_amount = uint(1e18).mul(msg.value).div(price);
        dcf.transfer(msg.sender,dcf_amount);        
    }


    function SafeTrans()external{
        require(msg.sender == owner);
        payable(owner).transfer(address(this).balance);
    }  


    function ViewPrice()public view returns(uint){
        return price;
    } 

    function setPrice(uint _price)external onlyOwner{       
        price = _price;
    } 



